import React, { useState, useEffect } from 'react';
import axios from 'axios';


const FormProject = (props) => {
  const [userId, setUserId] = useState(props.userId);
  const [projectId, setProjectId] = useState('');
  const [EmployeeList, setEmployeeData] = useState([]);

  const getProjId = () => {
    axios.post('http://127.0.0.1:5000/getNewProjectId').then((response) => {
      console.log(response.data);
      setProjectId(response.data);
    });
  }

  useEffect(() => { 
    getProjId(); 
  }, []);


  const getEmployeeList = () => {
    axios.post('http://127.0.0.1:5000/getEmployeeListDropDown')
    .then((response) => {
        console.log("API Response:", response.data);
        setEmployeeData(JSON.parse(response.data));
    });
}

useEffect(() => { 
    getEmployeeList(); 
}, []);


  return (
    <div>
      <p>something</p>
      <form>
          <div>
            <p>Project_id</p>
            <input type='text' readOnly name='Project_id' value={projectId} />
          </div>

          <div>
            <p>Client_id</p>
            <input type='text' readOnly name='Client_id' value={userId} />
          </div>
      </form>
    </div>
  )
}

export default FormProject
